import React from 'react'
import Person from './Person/Person'


export default persons = (props) => props.map((e, index) => { return <Person key={index} changed={(event) => props.nameChangedHandler(event, index)} click={props.deletePerson.bind(this, index)} name={e.name} age={e.age} > And I play Hocky</Person> })
